import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'

import Navbar from './Navbar'
import Jeopardy from './Jeopardy';
import Hello from './Hello'

function App() {
  return (
    <BrowserRouter>
      <Navbar />

      hello 

      <Routes>
        <Route index element={<Hello />} />

        <Route path='/jeopardy' element={<Jeopardy />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
